import React, {useState} from "react";
import "./Navbar.css"
import { Dropdown } from "./Dropdown";
import {Link} from "react-router-dom";


function Navbar() {
    const [click, setClick] = useState(false)
    const [dropdown, setDropdown] = useState(false)

    const handleClick = () => setClick(!click)
    const closeMobileMenu = () => setClick(false);

    return (
        <>
            <nav className="navbar">
                <Link to="/" className="nevbar-logo">
                    Greener
                </Link>
                <div className="menu-icon" onClick={handleClick}>
                    <i className={click ? 'fas fa-times' : 'fas fa-bars'} />
                </div>
                <ul className={click ? 'nav-menu active' : 'nav-menu'}>
                    <li className="nav-item">
                        <Link to='/recommand' className='nav-links' onClick={closeMobileMenu}>
                            식물추천
                        </Link>
                    </li>
                    <li className="nav-item">
                        <Link to='/hotel' className='nav-links' onClick={closeMobileMenu}>
                            식물호텔
                        </Link>
                    </li>
                    <li className="nav-item">
                        <Link to='/community' className='nav-links' onClick={closeMobileMenu}>
                            커뮤니티 <i className="fas fa-caret-down" />
                        </Link>
                        {dropdown && <Dropdown />}
                    </li>
                </ul>

            </nav>


        </>
    )
}

export default Navbar;
